import React, { Component } from 'react';
import { Container, Row, Col } from 'react-bootstrap';

class Foo extends Component {
    render() {
        return (
            <Container>

                <Row>
                    <Col><h3>Hello from the Foo.</h3></Col>
                </Row>
            </Container>

        )
    }
}

export default Foo
